import './App.css';
import { Defaultlayout } from './layout/Defaultlayout';
import { Ticket } from './pages/Ticket/ticketpage';
import { Ticketlist } from './pages/Ticketlist/Ticketlist';
import { Addtickets } from './pages/new_tickets/add_tickets';
import Entry from './pages/Entry/entry';
import { Dashbord } from './pages/Dashbord/dashbord';
import { BrowserRouter, Routes, Route } from "react-router-dom"


function App() {
  return (
    <div className="App">
      <BrowserRouter>
          <Routes>
          <Route exact path ='/' element ={<Entry />}></Route>
          {/* <Defaultlayout> */}
          <Route path='/' element={<Defaultlayout />}>
            <Route index path='dashboard' element={<Dashbord />}></Route>
            <Route path='addticket' element ={ <Addtickets />}> </Route>
            <Route path='tickets' element ={<Ticketlist />}></Route>
            <Route path='tickets:tid' element={<Ticket />}></Route>
          </Route>
          {/* </Defaultlayout> */}
        </Routes> 
        </BrowserRouter>
    </div>
  );
}

export default App;
